import DelTicket from './components/DelTicket'
import TicketDeleted from './components/TicketDeleted' 
document.body.style.backgroundColor='white'

function App() {
  const [isLoggedIn, setLoggedIn] = useState(false);

  const handleLogin = async (e) => {
    e.preventDefault();

    try {
      const response = await fetch("http://localhost:8081/CheckLogin", {
        method: "POST",
        headers: {
          "Content-Type": "application/json",
        },

      });

      if (data.status==="success") {
        setLoggedIn(true);      }
      }catch (error) {
        console.error("Error:", error);
      }


  };





  const [isButtonDisabled, setButtonDisabled] = useState(false);

    const disableButton = () => {
        setButtonDisabled(true);

    };

    const enableButton = () => {
        setButtonDisabled(false);

    };

  const [mode, setmode] = useState('light')

  const toggleMode=()=>{

    if(mode==='light' || mode==="grey"|| mode==="black"){
      setmode('blue')
      document.body.style.backgroundColor='blue'
      showAlert("Dark mode enabled","success")
      document.title='TextUtils ->Dark Mode'
    }
    else{
      setmode('light')
      document.body.style.backgroundColor='white'
      showAlert("Light mode enabled","success")
      document.title='TextUtils ->Light Mode'
    }
  }
  const toggleModeGrey=()=>{

    if(mode==='light' || mode==="blue"|| mode==="black"){
      setmode('grey')
      document.body.style.backgroundColor='grey'
      showAlert("Dark mode enabled","success")
      document.title='TextUtils ->Dark Mode'
    }
    else{
      setmode('light')
      document.body.style.backgroundColor='white'
      showAlert("Light mode enabled","success")
      document.title='TextUtils ->Light Mode'
    }
  }
  const toggleModeBlack=()=>{

    if(mode==='light'|| mode==="blue"|| mode==="grey"){
      setmode('black')
      document.body.style.backgroundColor='black'
      showAlert("Dark mode enabled","success")
      document.title='TextUtils ->Dark Mode'
    }
    else{
      setmode('light')
      document.body.style.backgroundColor='white'
      showAlert("Light mode enabled","success")
      document.title='TextUtils ->Light Mode'
    }
  }

  const [alert, setalert] = useState(null)
  const showAlert=(message,type)=>{
    setalert({
      msg:message,
      type:type

    })
    setTimeout(()=>{
      setalert(null)
    },2000)
  }

  return (
 <>
 {/* <IntegerProvider>
      <Login />
      <ConcertEntry />
    </IntegerProvider> */}
 <Router>

 {/* <h2 className=' my-3 text-center nav-link' style={{font:"font-family:arial",color:"red"}} >Student Management System</h2> */}
  {/* <b><Navbar navbar_item1="Ticket Booking System" navbar_item2="Concert Management System" navbar_item3="Log in" about="About" mode={mode} toggleMode={toggleMode} toggleModeGrey={toggleModeGrey} toggleModeBlack={toggleModeBlack}/></b> */}
  {isLoggedIn ? (
      <b>
        <Navbar
          navbar_item1="Ticket Booking System"
          navbar_item2="Concert Management System"
          navbar_item3="Log in"
          about="About"
          mode={mode}
          toggleMode={toggleMode}
          toggleModeGrey={toggleModeGrey}
          toggleModeBlack={toggleModeBlack}
        />
      </b>
    ) : (
      <Textform />
    )}

   {/* <Alert alert={alert}/> */}
   <div className="container my-3"  >
    <Routes>
      {/* <Route exact path='/' element={<Textform/>}/> */}
      <Route exact path="/About" element={<About />}/>
      {/* <Route exact path="/" element={<Textform mode={mode}showAlert={showAlert} heading="Try TextUtils-Word counter,Character counter, Remove extra spaces"  />}/> */}
